import React from "react";
import { Container } from "react-bootstrap";
import { Row } from "react-bootstrap";
import { Col } from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import '../App.css';
import { Button } from "react-bootstrap";
import { Card } from "react-bootstrap";

export class Search extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            username : '',
            gitHubUserFound: false,
            gitLabUserFound: false,

            gitHubUser: {},
            gitLabUser: {},
            gitRepos: [],


        };
        this.handleSubmit = this.handleSubmit.bind(this);
        this.handleClick = this.handleClick.bind(this);

    }

    //pass in a handler as props that feeds the user info back to the parent

    handleClick(e) {



        window.open(
            `/gitHubUser`, //change this to user profile route for github or gitlab
            '_blank' 
          );
    }

   // handleChange(e) { this.setState({username: e.target.value})};

    async handleSubmit(e) {

        e.preventDefault();

        let formData = new FormData(e.target);
        const data = {};

        formData.forEach(function(value, key) {
            data[key] = value;
        });

        const jsonData = JSON.stringify(data);

        console.log(data.username)


        // let username = this.state.username;
        let githubapi = '/github/' + username;
        // let gitlabapi = '/gitlab/' + username;



        try {
            fetch(githubapi)
                .then(res => res.json())
                .then(
                    (result) => {
                        this.setState({
                          gitHubUser: result,
                          gitRepos: result.repos,
                          gitHubUserFound: true

                        })
                        let gitHubUser = this.state.gitHubUser
                        alert(gitHubUser.name);  
                        console.log(result)
                    },
                    (error) => {
                      console.log(error)
                    }
                );
            } catch {
                this.setState({gitHubUserFound: false});
                console.log('No gitHub user found');
            }

        //     try {
        //         fetch(gitlabapi)
        //             .then(res => res.json())
        //             .then(
        //                 (result) => {
        //                     this.setState({
        //                       gitLabUser: result,
        //                     })
        //                     let gitLabUser = this.state.gitLabUser
        //                     alert(gitLabUser.name);  
        //                     console.log(result)
        //                 },
        //                 (error) => {
        //                   console.log(error)
        //                 }
        //             );
        //         } catch {
        //             this.setState({gitLabUserFound: false});
        //             console.log('No gitLab user found');
        //         }





    }

    componentDidUpdate() {
        this.props.handleSearchResults(this.state.gitHubUser, this.state.gitLabUse, "random message")
    }


    render () {
        return (
            <div className="main">


                <Container className="search">

                    <Row>
                        <h2 className="text-center">Enter a username </h2>
                        <p>you entered username {this.state.username}</p>
                        <p>We found the following user on gitHub: {this.state.gitHubUser.name}</p>
                        <p>This is a props test {this.props.userMessage}</p>
                    </Row>
                    <Row>
                        <form className='text-center' onSubmit={this.handleSubmit}>
                            <input className="search-bar" type="text" name="username" id="username"></input>
                            <input type="submit" value="Search!"  className="btn-internal"></input>
                        </form>
                    </Row>
                    <Row className="search-results text-center">

                        <Col></Col>

                        <Card style={{ width: '18rem' }} className="text-center">

                            <Card.Img className="search-img" variant="top" src="https://static.wixstatic.com/media/e40e4e_84f5fe99e6974420a0c6dc070b14777d~mv2_d_2079_2079_s_2.jpg/v1/fill/w_310,h_306,al_c,q_80,usm_0.66_1.00_0.01,enc_auto/Gabriele_JPG.jpg" />
                            <Card.Body>
                                    <Card.Title>GitLab: </Card.Title>
                                    <Card.Text>
                                        {null}
                                    </Card.Text>
                                    <button onClick={this.handleClick} className="btn-internal">See user info</button>
                                </Card.Body>
                        </Card>

                        <Card style={{ width: '18rem' }} className="text-center">

                            <Card.Img className="search-img" variant="top" src={this.state.gitHubUser.avatar_url}  alt="..."  />
                            <Card.Body>
                                    <Card.Title>GitHub:</Card.Title>
                                    <Card.Text>
                                    {this.state.gitHubUser.name} <br />
                                    {this.state.gitHubUser.bio}
                                    </Card.Text>
                                    <button  className="btn-internal" onClick={this.handleClick}>See user info</button>
                            </Card.Body>
                        </Card>
                        <Col></Col>





                    </Row>




                </Container>
            </div>

        )
    }


}
